import React from "react";

const UserProfile = ({ fullName, email, profileImage, setcontainer }) => {
  return (
    <div className="card" style={{ width: "54rem" }}>
    <h4 className="display-8 fw-bold">Profile</h4>
    <img src={profileImage?profileImage:"images/profile.png"} className="card-img-top" alt="User Profile" />
      <div className="card-body">
        <h5 className="card-title">{fullName}</h5>
        <p className="card-text">{email}</p>
        <img src="images\arrow.png" alt="....." onClick={()=>{setcontainer('main')}}/>
        <p className="card-text" onClick={()=>{setcontainer('main')}}>Go Back</p>
      </div>
    </div>
  );
};

export default UserProfile;
